import React from 'react'
import '../css/logger.css'
import Exercise from './Exercise'

export default function Logger() {
    return (
        <div className='container'>
            <table className='exercise-table'>
                <tr>
                    <th>Exercise</th>
                    <th>Weight</th>
                    <th>Sets</th>
                </tr>
                <Exercise />
                <Exercise />
                <Exercise />
                <Exercise />
                <Exercise />
                <Exercise />
            </table>
        </div>
